import React from "react"
import {ListItem, ListItemSecondaryAction} from '@material-ui/core'


export const CustomList = ({children, icon}) => {

    return (
        <ListItem button>
            {children}
            <ListItemSecondaryAction>
                {icon}
            </ListItemSecondaryAction>
        </ListItem>
    )
};
